import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';
import './App.css';
import './Find.css';
import flagIcon from './icons/flag.png';
import searchIcon from './icons/search.png';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <nav>
            <NavLink 
              exact 
              to="/" 
              className={({ isActive }) => isActive ? "active-link" : ""}
            >
              Home
            </NavLink>
            <NavLink 
              to="/find" 
              className={({ isActive }) => isActive ? "active-link" : ""}
            >
              Find
            </NavLink>
            <NavLink 
              to="/report" 
              className={({ isActive }) => isActive ? "active-link" : ""}
            >
              Report
            </NavLink>
          </nav>
        </header>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/find" element={<Find />} />
          <Route path="/report" element={<Report />} />
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="content">
      <div className="option">
        <div className="icon">
          <img src={searchIcon} alt="Search Icon" className="icon-image" />
        </div>
        <button className="nav-button" onClick={() => window.location.href='/find'}>Find Your ID</button>
      </div>

      <div className="option">
        <div className="icon">
          <img src={flagIcon} alt="Flag Icon" className="icon-image" />
        </div>
        <button className="nav-button" onClick={() => window.location.href='/report'}>Report A Lost ID</button>
      </div>
    </div>
  );
}

function Find() {
  const [searchQuery, setSearchQuery] = useState('');
  const [results, setResults] = useState([]);

  const handleSearch = () => {
    // Simulated search logic - replace with actual search logic
    const simulatedResults = [
      { id: 1, name: "John Doe", idNumber: "12345", location: "Library" },
      { id: 2, name: "Jane Smith", idNumber: "67890", location: "Cafeteria" }
    ];
    const filteredResults = simulatedResults.filter(item =>
      item.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
      item.idNumber.includes(searchQuery)
    );
    setResults(filteredResults);
  };

  return (
    <div className="find-container">
      <h2>Find Your Lost ID</h2>
      <input
        type="text"
        value={searchQuery}
        onChange={(e) => setSearchQuery(e.target.value)}
        placeholder="Enter name or ID number..."
        className="search-bar"
      />
      <button onClick={handleSearch} className="search-button">Search</button>
      <div className="results-container">
        {results.length > 0 ? (
          results.map(item => (
            <div key={item.id} className="result-item">
              <h3>{item.name}</h3>
              <p>ID Number: {item.idNumber}</p>
              <p>Found at: {item.location}</p>
            </div>
          ))
        ) : (
          <p>No results found.</p>
        )}
      </div>
    </div>
  );
}


function Report() {
  return <h2>Report Page</h2>;
}

export default App;
